Find more info about both of them, and application info for the Nov 9 deadline at vancouvermanuscriptintensive.com 

Claudia Casper has written three novels: The Reconstruction, a best-seller, published by Penguin Canada and in the UK, US, and Germany; The Continuation of Love by Other Means, also published by Penguin and short-listed for the Ethel Wilson Fiction Prize; and most recently, The Mercy Journals, published by Arsenal Pulp Press and winner of the 2017 Phillip K. Dick Award for distinguished science-fiction. She has also written creative non-fiction (Event Magazine, Geist, Lit-Hub, Globe and Mail, Dropped Threads etc.), book reviews for the Globe and Mail and the Vancouver Sun, and is currently collaborating on France/Canada feature film adaptation of her first novel. She has taught as a sessional at Kwantlen Polytechnic University, and appeared at the 2017 Iceland Writerâ€™s Retreat, and most recently the Pasadena LitFest. She will be the Whistler writer-in-residence for 2018. She has been a mentor with VMI for 9 years.

Both Claudia and Cathleen have guided writers through to publication with their wisdom!  #writing #mentor #editing #VMI 

Cathleen With's first book, skids (Arsenal Pulp, 2006), about street kids on the Downtown Eastside of Vancouver, was short-listed for a Relit Award. Among her many adventures, Cathleen has worked at a camp for disabled kids in Squamish, and in Hawaii and Australia. She served as a drama educator in Kathmandu, a caregiver at Mother Teresaâ€™s Home in Calcutta, a teacher to former sex trade kids in Cambodia, and as a teacher in Inuvik, NT, and Seoul, Korea. Having Faith in the Polar Girlsâ€™ Prison (winner of the Ethel Wilson Fiction Award), is her first novel. She was proud to be in the City of Vancouver short-listed anthology V6A: Writing from the Downtown Eastside (Arsenal 2013).";}i:173;a:1:{s:14:"comments_count";i:0;}i:174;a:1:{s:11:"likes_count";i:2;}i:175;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuzOmBgKeO";}i:176;a:1:{s:5:"image";s:238:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118698081_607497286544781_6541432742833430165_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=109&_nc_ohc=5L-Mfle1KX0AX8HUwnB&oh=5044f9d953d5421aa0395b41e28acc4d&oe=5F7CD3BA";}i:177;a:1:{s:4:"type";s:7:"sidecar";}i:178;a:1:{s:8:"owner_id";i:714490783;}i:179;a:1:{s:14:"owner_username";s:0:"";}i:180;a:1:{s:14:"owner_fullname";s:0:"";}i:181;a:1:{s:9:"owner_pic";s:0:"";}i:182;a:1:{s:2:"id";s:19:"2391073615304810306";}i:183;a:1:{s:10:"short_code";s:11:"CEuzMjgDV9C";}i:184;a:1:{s:12:"created_time";i:1599258208;}i:185;a:1:{s:7:"caption";s:475:"The birth date of the second President of India, Sarvepalli Radhakrishnan, 5 September 1888, has been celebrated as Teacher's Day since 1962

